$(".mbt").each((t,e)=>{$(e).html(`${["Top","School","Community","Health","FAQ"][t]}`)}),$("#her01t").html('Information from the <span id="her02t" class="text--blue">Year 15 Round</span>'),$("#hsfe0t").html("Thank you for participating in the Survey of Parents and Families!"),$("#hsfe1t").html("Here are some highlights from what we learned in the Year 15 Round."),$(".que1s").html("How are your answers and information collected used?<span>&#x25BC;</span>"),$("#que1s .ans").html("As you know, the Survey of Parents and Families gathers a great deal of information. We combine your answers and the other information we collect with those of all the study families to create a data file that experts can analyze."),$(".que2s").html("How do we protect your privacy?<span>&#x25BC;</span>"),$("#que2s .ans").html("To protect your privacy, Survey staff removes information from the file that could identify\n\t\t\t\t\t\t      you or others (such as names and addresses)."),$(".que3s").html("Why is the information collected valuable?<span>&#x25BC;</span>"),$("#que3s .ans").html("Experts who study the information write papers describing the findings. These papers\n\t\t\t\t\t\t      are helpful to people who run organizations that provide services to families, and government\n\t\t\t\t\t\t      officials who design programs and policies to support families. Program staff\n\t\t\t\t\t\t      and policymakers tell us that the information from the Survey is extremely valuable to\n\t\t\t\t\t\t      them."),$(".que4s").html("How did the study get started?<span>&#x25BC;</span>"),$("#que4s .ans").html("With funding from the National Institutes of Health, a group of researchers at Princeton\n\t\t\t\t\t\t      and Columbia Universities developed the Survey of Parents and Families to provide\n\t\t\t\t\t\t      information about the health and well-being of American families. Since 1998, the\n\t\t\t\t\t\t      Survey has followed nearly 5,000 families throughout the United States. Parents were\n\t\t\t\t\t\t      first interviewed shortly after the birth of a child (the “study child”) and were interviewed\n\t\t\t\t\t\t      again around the time of the child’s first, third, fifth, ninth, and fifteenth birthdays.\n\t\t\t\t\t\t      The participation of the child has been extremely important as they have gotten\n\t\t\t\t\t\t      older. As they transition from teen to adult, we hope to include more of their perspective\n\t\t\t\t\t\t      and experiences."),$(".cut").html('If you have any<br>questions or comments<br>please contact us<br>by <a class="text--blue" href="mailto:SurveyofParents@westat.com">email</a> or call<br><a href="tel:+18883122295" class="text--blue">1-888-312-2295.</a>'),$("#footer p").html("Survey of Parents and Families &#124; Newsletter 2018");